import React from 'react';
import Content from '../../../components/Content.js';
import ProjectTitle from '../../../components/ProjectTitle.js';
import FadeIn from 'react-fade-in';

import { Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer';
import ReactPDF from '@react-pdf/renderer';

// Create styles
const styles = StyleSheet.create({
    page: {
      flexDirection: 'row',
      backgroundColor: '#E4E4E4'
    },
    section: {
      margin: 10,
      padding: 10,
      flexGrow: 1
    }
  });

  // Create Document Component
  const MyDocument = () => (
    <Document>
      <Page size="A4" style={styles.page}>
        <View style={styles.section}>
          <Text>Section #1</Text>
        </View>
        <View style={styles.section}>
          <Text>Section #2</Text>
        </View>
      </Page>
    </Document>
  );

function StatFinalPage(props) {
    window.scrollTo(0, 0);
    const width = 7;
    return (
        <FadeIn>
            <ProjectTitle info={props.info} width={width} />
            <Content width={width}>
                <body>

                    <hr class="rounded" />

                    <embed src="https://drive.google.com/file/d/11pViyafRGxKO3dA_r3fh2r00MjiWkgLI/view?usp=sharing" width="500" height="375"></embed>
                </body>
            </Content>
        </FadeIn>
    );
}

ReactPDF.render(<MyDocument />, `${'.../assets/project/stat107ca/stat107ca.png'}}/example.pdf`);

export default StatFinalPage;
